INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100107', 'www.ypippijkt.localhost', 'Informasi Ujian Seleksi PPDB 2018-2019', 'informasi-ujian-seleksi-ppdb-2018-2019', '<h2 style="border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85); text-align: center;"><br></h2><h2 style="border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);"><strong style="border: 0px; padding: 0px;">Unit SMP :</strong></h2><ul style="border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;"><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Calon siswa baru harus mengikuti ujian tertulis yang terdiri materi soal campuran&nbsp;<strong style="border: 0px; padding: 0px;">(matematika, IPA, Pengetahuan Umum, B. Indonesia, &amp; B. Inggris materi SD).</strong></li><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style="border: 0px; padding: 15px 0px;">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMP, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul><h2 style="border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);"><strong style="border: 0px; padding: 0px;">Unit SMA :</strong></h2><ul style="border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;"><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Calon siswa baru harus mengikuti&nbsp;ujian tertulis yang terdiri materi soal campuran yaitu&nbsp;<strong style="border: 0px; padding: 0px;">Matematika, Bahasa Indonesia, Bahasa Inggris, &amp; Mata Pelajaran Umum (IPA &amp; IPS) materi SMP.</strong></li><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style="border: 0px; padding: 15px 0px;">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMA, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul><h2 style="border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);"><strong style="border: 0px; padding: 0px;">Unit SMK :&nbsp;</strong></h2><ul style="border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;"><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Calon siswa baru harus mengikuti&nbsp;ujian tertulis yang terdiri materi soal campuran&nbsp;<strong style="border: 0px; padding: 0px;">(Matematika, Bahasa&nbsp;Indonesia, &amp; Bahasa&nbsp;Inggris materi SMP).</strong></li><li style="border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style="border: 0px; padding: 15px 0px;">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMK, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul>', 'demo, berita', ',26939,', '1', '0', '1', '1', '0', '0', '0', '0', '0', '131', '26180690ppdb.jpg', '2018-04-24 12:44:20', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100293', 'www.ypippijkt.localhost', 'INFORMASI WISUDA / PELEPASAN SMA-SMK YP IPPI PETOJO & CAKUNG', 'informasi-wisuda--pelepasan-sma-smk-yp-ippi-petojo--cakung', '<p class="MsoNormal" align="center" style="margin: 15.75pt 0in 7.9pt; text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-family: Andalus, serif; color: rgb(34, 34, 34);"><font size="2">UNDANGAN WISUDA/PELEPASAN<o:p></o:p></font></span></b></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">Setelah melalui perjuangan yang\r\npanjang, siswa-siswi kelas XII telah menyelesaikan pendidikannya di SMA dan SMK\r\nYP IPPI Petojo &amp; Cakung ( JAKARTA) selama 3 tahun, dan telah mengikuti\r\nserangkaian kegiatan mulai USBN &amp; UNBK, dengan hasil&nbsp;<b style="">LULUS 100%.</b></span><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><o:p></o:p></span></font></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><font size="2">&nbsp;<span style="border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in">Selamat untuk kalian semua siswa-siswi &nbsp;kelas XII semoga keberhasilan ini merupakan\r\nawal dari kesuksesan dimasa yang akan datang.</span><o:p></o:p></font></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><font size="2">&nbsp;<span style="border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in">Dalam rangka mengakhiri kegiatan pendidikan di SMA dan SMK YP IPPI\r\nPetojo &amp; Cakung ( JAKARTA), mengharap atas kehadiran siswa-siswi &nbsp;XII pada :</span></font></span></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><font size="2"><span style="border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in"><br></span></font></span></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">Hari/\r\nTanggal&nbsp; &nbsp; &nbsp; : Rabu, 09 Mei 2018</span></b><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><o:p></o:p></span></b></font></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">Pukul&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp;08.00 WIB </span></b><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);"><o:p></o:p></span></b></font></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;"><font size="2">Tempat&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;:&nbsp;Gedung Sasana Kriya &nbsp;TAMAN MINI\r\nINDONESIA INDAH &nbsp;(TMII)</font></span></b></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;"><font size="2"><br></font></span></b></p>\r\n\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 76.5pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">PETOJO </span></b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">: &nbsp;Titik Kumpul di Sekolah YP IPPI Petojo / Depan\r\nBCA Pukul 06.00 WIB dan berngkat bersama menggunakan BUS &nbsp;Menuju TAMAN MINI INDONESIA INDAH&nbsp; (TMII<o:p></o:p></span></font></p>\r\n\r\n<p class="MsoNormal" style="margin: 0in 0in 0.0001pt 76.5pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">CAKUNG </span></b><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">: Titik Kumpul di &nbsp;Sekolah YP IPPI &nbsp;Cakung &nbsp;Pukul\r\n06.00 WIB dan &nbsp;berngkat bersama\r\nmenggunakan BUS &nbsp;Menuju TAMAN MINI\r\nINDONESIA INDAH&nbsp; (TMII<o:p></o:p></span></font></p>\r\n\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><font size="2"><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;">.Pakaian&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n:&nbsp;Putra :&nbsp;</span><span style="line-height: 150%; font-family: Helvetica, sans-serif; color: rgb(34, 34, 34);">Memakai kemeja lengan\r\npanjang berdasi</span><span style="line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;"> menggunakan Jas&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; </span></font><span style="text-indent: 0.5in; line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;"><font size="2">Putri&nbsp;:&nbsp;</font></span><span style="text-indent: 0.5in; line-height: 150%; font-family: Helvetica, sans-serif; color: rgb(34, 34, 34);"><font size="2">Memakai kebaya (pakaian resmi Nasional).</font></span></p>', 'UNDANGAN WISUDA', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '46', '87144769Wisuda_0.png', '2018-05-04 19:32:05', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100304', 'www.ypippijkt.localhost', 'JADWAL PEMBAGIAN CETAK SKL', 'jadwal-pembagian-cetak-skl', '<div><b>SMK YP IPPI CAKUNG</b></div><div>Hari : Senin s.d Rabu</div><div>Tanggal : 7 Mei s.d 9 Mei 2018</div><div><br></div><div><div><b>SMK YP IPPI PETOJO</b></div><div>Hari : Kamis s.d Jumat</div><div>Tanggal : 10 Mei s.d 12 Mei 2018</div></div><div><br></div><div><div><b>SMA YP IPPI CAKUNG</b></div><div>Hari : Senin s.d Rabu</div><div>Tanggal : 14 Mei s.d 16 Mei 2018</div></div><div><br></div><div><div><b>SMA YP IPPI PETOJO</b></div><div>Hari : Kamis s.d Jumat</div><div>Tanggal : 17 Mei s.d 19 Mei 2018</div></div><div><br></div>', 'JADWAL PEMBAGIAN CETAK SKL', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '41', '146998655skl.jpg', '2018-05-05 11:40:47', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100557', 'www.ypippijkt.localhost', 'Kegiatan Belajar Mengajar ( KBM ) di Sekolah YP IPPI', 'kegiatan-belajar-mengajar--kbm--di-sekolah-yp-ippi', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.0pt;font-family:\r\n" verdana","sans-serif";mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:="" "times="" roman";color:#262626;mso-themecolor:text1;mso-themetint:217;="" mso-fareast-language:in"="">1. Membaca Al-Quran Sebelum Belajar<o:p></o:p></span></b></p>\r\n\r\n<p class="MsoNormal" style="text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:10.0pt;line-height:115%;font-family:" verdana","sans-serif";="" mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:arial;="" color:#323233;background:#ebebeb;mso-fareast-language:in"=""><br>\r\n</span><span style="font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; color: rgb(50, 50, 51); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Suara lantunan ayat-ayat suci yang dibacakan serempak oleh para siswa pun\r\nseolah memenuhi setiap ruangan. Suasana syahdu nan indah lantunan alquran pun\r\nbegitu terasa. Terlebih&nbsp; tak hanya Siswa &nbsp;SMP IT yang bertadarus, namun semua siswa SMA\r\ndan SMK YP IPPI.<br>\r\n<br>\r\nDengan kegiatan tadarus tersebut, Pihak sekolah dapat ikut menanamkan\r\nnilai-nilai keimanan dan ketakwaan terhadap para siswanya selama berada di\r\nsekolah. </span><span style="font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; color: rgb(45, 45, 45); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Dampak langsung dari membaca Alquran, kata Abdul Basit Siswa Kls XII\r\nbisa menghafal surat-surat pendek yang ada di dalam Alquran. <br>\r\n</span><span style="font-size:10.0pt;line-height:115%;font-family:" verdana","sans-serif";="" mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:"times="" roman";="" color:#262626;mso-themecolor:text1;mso-themetint:217;mso-fareast-language:in"=""><br>\r\n<b>2. Literasi Sekolah</b></span><span style="font-size:10.0pt;line-height:115%;font-family:" verdana","sans-serif";="" mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:"times="" roman";="" mso-fareast-language:in"=""><o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(42, 42, 42); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Sekolah berperan\r\npenting dalam mengembangkan kreativitas siswa dan guru untuk mendongkrak\r\nliterasi bangsa. Sekolah dapat mengembangkan keunggulan dalam literasi yang\r\ndimulai dari membaca hingga menulis.<br>\r\n<br>\r\nDi sekolah YP IPPI Jakarta tidak hanya menyediakan perpustakaan dengan\r\nfasilitas buku-buku yang menarik dan ruangan perpustakaan nyaman, tetapi\r\npembelajaran di sekolah pun dimanfaatkan untuk meningkatkan literasi siswa.</span><span style="font-size:10.0pt;font-family:" verdana","sans-serif";mso-bidi-font-family:="" arial;color:#2a2a2a"=""><br>\r\n</span><b><span style="font-size:10.0pt;\r\nfont-family:" verdana","sans-serif";mso-fareast-font-family:"times="" new="" roman";="" mso-bidi-font-family:"times="" roman";color:#262626;mso-themecolor:text1;="" mso-themetint:217;mso-fareast-language:in"=""><br>\r\n3. Jumat &nbsp;Berkah<br></span></b><img src="https://i.imgur.com/rI7IWU7.jpg" width="420"></p>\r\n\r\n<p class="MsoNormal"><span style="font-size: 10pt; line-height: 115%; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Seluruh Siswa/Siswi Guru dan juga karyawan SMP-SMA-SMK YP IPPI Jakarta,\r\nmembaca surah Yasin sebelum memasuki ruang kelas, setiap Jumat. Hal tersebut\r\nberguna untuk melatih para murid menanamkan nilai-nilai keimanan di sekolah.</span><span style="font-family:" verdana","sans-serif""=""><o:p></o:p></span></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(38, 38, 38); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Salah seorang guru, Bpk Arpan Siregar, Jumat (18/5/2018)\r\nmengatakan, kegiatan tersebut bertujuan untuk menambah keimanan dan ketaqwaan\r\npara murid kepada Alloh SWT. Siangnya dilanjutkan dengan shalat Jumat bersama Siswa Guru dan karyawan.</span><span style="font-size:10.0pt;font-family:\r\n" verdana","sans-serif";color:#262626;mso-themecolor:text1;mso-themetint:217"=""><br>\r\n<br>\r\n<b>4. Study Tour<br></b><img src="https://i.imgur.com/s4x0hZm.jpg" width="420"><o:p></o:p></span></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.0pt;font-family:" verdana","sans-serif";="" color:#262626;mso-themecolor:text1;mso-themetint:217"="">Diselenggarakan di akhir &nbsp;tahun ajaran, untuk mengajak anak-anak ke\r\nobyek-obyek wisata, seperti museum atau tempat-tempat lain yang dipilih.\r\nKegiatan ini selain menyenangkan bagi anak-anak juga menambah&nbsp; ilmu pengetahuan setelah mengikuti\r\npembelajaran selama satu tahun ajaran di kelas. Serta&nbsp; kegiatan ini tidak\r\nmemberatkan bagi orang tua dari segi pendanaan.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.0pt;\r\nfont-family:" verdana","sans-serif";color:#262626;mso-themecolor:text1;="" mso-themetint:217"="">&nbsp;5. Kesehatan<br></span></b><img src="https://i.imgur.com/DQD999V.jpg" width="420"><b><span style="font-size:10.0pt;\r\nfont-family:" verdana","sans-serif";color:#262626;mso-themecolor:text1;="" mso-themetint:217"=""><o:p></o:p></span></b></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.0pt;font-family:" verdana","sans-serif";="" color:#262626;mso-themecolor:text1;mso-themetint:217"="">Bekerjasama dengan\r\nPUSKESMAS di lingkungan SMP-SMA-SMK YP IPPI, pemeriksaan gigi, mata dan\r\nkesehatan pada umumnya rutin dilakukan tanpa dipungut biaya. Imunisasi juga\r\ndilakukan mengikuti program imunisasi yang didanai oleh pemerintah, menjadikan\r\nanak murid lebih terpantau dan terjaga kesehatannya.<o:p></o:p></span></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><b><span style="font-size:10.0pt;\r\nfont-family:" verdana","sans-serif";color:#262626;mso-themecolor:text1;="" mso-themetint:217"="">&nbsp;6. Pramuka<br></span></b><img src="https://i.imgur.com/PG0P9az.jpg" width="420"><b><span style="font-size:10.0pt;\r\nfont-family:" verdana","sans-serif";color:#262626;mso-themecolor:text1;="" mso-themetint:217"=""><o:p></o:p></span></b></p>\r\n\r\n<p style="margin: 12pt 0cm; text-align: justify; line-height: 15.75pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;"><span style="font-size:10.0pt;font-family:" verdana","sans-serif";="" color:#262626;mso-themecolor:text1;mso-themetint:217"="">Ekstra kulikuler ini\r\nmendidik murid-murid agar memiliki jiwa kepemimpinan, kebersamaan, suka\r\nmenolong dan gotong royong. Nilai-nilai dasar yang selama ini hampir dilupakan\r\noleh sekolah-sekolah yang lain. Penanaman nilai-nilai ini dilakukan dengan\r\nberbagai macam kegiatan yang melibatkan seluruh anggota pramuka.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="text-align:justify"><span style="font-size:10.0pt;\r\nline-height:115%;font-family:" verdana","sans-serif";color:#262626;mso-themecolor:="" text1;mso-themetint:217"="">&nbsp;</span></p>', 'KEGIATAN KBM', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '38', '25191230a3jpg-420x420copy.jpg', '2018-05-22 11:14:59', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100399', 'www.ypippijkt.localhost', 'Kegiatan Wisuda Kelas XII SMA-SMK YP IPPI Jakarta', 'kegiatan-wisuda-kelas-xii-sma-smk-yp-ippi-jakarta', '<div style="text-align: justify;"><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:9.0pt;\r\nfont-family:" arial","sans-serif";mso-fareast-font-family:"times="" new="" roman";="" color:black;mso-themecolor:text1;mso-fareast-language:in"="">Pada tanggal 9 Mei\r\nlalu, SMA-SMK YP IPPI Jakarta menyelenggarakan kegiatan pelepasan siswa-siswi\r\nkelas XII di Gedung Sasana Kriya TMII. Begitu khidmadnya kegiatan ini hingga tak sedikit yang meneteskan\r\nair mata saat menyanyikan lagu terimakasih Guruku.<br>\r\n<br>\r\nPengalungan gordon merupakan tanda siap dilepaskannya para wisudawan. Satu per\r\nsatu nama wisudawan dipanggil untuk melaksanakan prosesi sakral ini. Tiga tahun\r\nmenggali ilmu, kini saatnya menebarkan manfaat atas ilmu yang dimiliki. Kurang\r\nlebih begitulah makna pada sesi ini.<br>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span><span style="font-size:10.5pt;font-family:" opensans","serif";="" mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:"times="" roman";="" color:black;mso-themecolor:text1;mso-fareast-language:in"=""><o:p></o:p></span></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:9.0pt;\r\nfont-family:" arial","sans-serif";mso-fareast-font-family:"times="" new="" roman";="" color:black;mso-themecolor:text1;mso-fareast-language:in"="">Di mana ada\r\npertemuan, maka akan ada perpisahan. Begitulah pepatah mengatakan. Tak luput\r\npula perkataan pepatah ini juga berlaku kepada para wisudawan SMA-SMK YP IPPI\r\nJakarta. <br><br>Setelah 3 tahun berkumpul, kini saatnya menempuh jalan masing-masing\r\nuntuk menggapai tiap mimpi yang tertoreh di hati apakah melanjutkan kuliah atau\r\nberkerja nantinya.<br><br>\r\n<!--[endif]--></span><span style="font-size:10.5pt;font-family:" arial","sans-serif";="" mso-fareast-font-family:"times="" new="" roman";color:black;mso-themecolor:text1;="" mso-fareast-language:in"=""><o:p></o:p></span></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 15pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size:9.0pt;\r\nfont-family:" arial","sans-serif";mso-fareast-font-family:"times="" new="" roman";="" color:black;mso-themecolor:text1;mso-fareast-language:in"="">Perpisahan hari ini\r\nbukan untuk dikenang atau ditangisi. Tetapi perpisahan hari ini adalah untuk\r\ndilewatkan. Karena bagaimanapun juga perpisahan adalah awal perjalanan hidup\r\nyang masih panjang.&nbsp;<br></span><span style="font-size: 9pt;"><br>Demikianlah hingga ditutuplah acara wisuda ini dengan pembacaan doa bersama\r\nyang dipimpin oleh Guru Agama Bpk Hilman.</span></p></div>', 'wisuda,wisuda yp ippi,wisuda sma smk yp ippi,', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '34', '14256783a3jpg-420x420.jpg', '2018-05-13 15:56:29', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100338', 'www.ypippijkt.localhost', 'LSP YP IPPI', 'lsp-yp-ippi', '<p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-align:justify;text-indent:.5in"><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">Lembaga\r\nsertifikasi profesi adalah lembaga pendukung BNSP yang bertanggung jawab\r\nmelaksanakan sertifikasi kompetensi profesi. LSP SMK YP IPPI PETOJO yang\r\ndibentuk berbadan h</span><span lang="IN" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial;mso-ansi-language:IN">u</span><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">kum\r\ndan dibentuk oleh Lembaga Pendidikan dan Pelatihan&nbsp; yang di</span><span lang="IN" style="font-family:\r\n&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial;mso-ansi-language:IN">registr</span><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">asi\r\noleh BNSP.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-align:justify;text-indent:.5in"><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\nArial;mso-ansi-language:FI">LSP</span><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial">SMK YP IPPI PETOJO</span><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial;\r\nmso-ansi-language:FI">mempunyai tugas mengembangkan standar kompetensi,\r\nmelaksanakan uji kompetensi, menerbitkan sertifikat kompetensi serta melakukan\r\nverifikasi tempat uji kompetensi.<o:p></o:p></span></p>\r\n\r\n<p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-align:justify;text-indent:.5in"><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\nArial;mso-ansi-language:FI">Dalam melaksanakan tugas dan fungsi, LSP</span><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">SMK\r\nYP IPPI PETOJO</span><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial;mso-ansi-language:FI">mengacu pada pedoman yang\r\ndikeluarkan oleh BNSP. Dalam pedoman tersebut ditetapkan persyaratan yang harus\r\ndipatuhi untuk menjamin agar lembaga sertifikasi menjalankan sistem sertifikasi\r\npihak </span><span lang="IN" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial;mso-ansi-language:IN">pertama </span><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial;\r\nmso-ansi-language:FI">secara konsisten dan profesional, sehingga dapat diterima\r\ndi tingkat nasional yang relevan demi kepentingan pengembangan sumber daya\r\nmanusia dalam aspek peningkatan kualitas dan perlindungan tenaga kerja.<o:p></o:p></span></p><ol style="margin-top:0in" start="1" type="A">\r\n <li class="MsoNormal" style="margin-top:6.0pt;text-align:justify;mso-list:l1 level1 lfo2;\r\n     tab-stops:list .5in"><b><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">VISI\r\n     : <o:p></o:p></span></b></li>\r\n</ol><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify"><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">Menjadi\r\nlembaga sertifikasi profesi yang menjamin kompetensi&nbsp; tenaga kerja yang mampu bersaing,professional,\r\nberakhlak mulia dan berwawasan lingkungan.<o:p></o:p></span></p><p class="MsoNormal" style="margin-left:.5in;text-align:justify"><b><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-bidi-font-family:Arial">&nbsp;</span></b></p><p class="MsoNormal" style="margin-left:35.7pt;text-align:justify;text-indent:\r\n-17.85pt;mso-list:l1 level1 lfo2;tab-stops:list .5in"><!--[if !supportLists]--><b><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;\r\nmso-fareast-font-family:&quot;Arial Narrow&quot;;mso-bidi-font-family:&quot;Arial Narrow&quot;">B.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-weight: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></b><!--[endif]--><b><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">MISI<o:p></o:p></span></b></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list 36.15pt"><!--[if !supportLists]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;">1.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">LSP SMK\r\nYP IPPI PETOJO menjamin menerapkan pedoman BNSP tahun 2014 dan&nbsp; ISO 17024 <o:p></o:p></span></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list 36.15pt"><!--[if !supportLists]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;">2.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">LSPSMK\r\nYP IPPI PETOJOsiap melaksanakan sertifikasi kompetensi secara profesional dan\r\nmampu bersaing.<o:p></o:p></span></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list 36.15pt"><!--[if !supportLists]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;">3.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">Memberikan\r\npelayanan uji&nbsp; sertifikasi kompetensi\r\nyang mengutamakan mutu dan kepuasan pelanggan .<o:p></o:p></span></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list 36.15pt"><!--[if !supportLists]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;">4.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">LSP</span><span lang="IN" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:\r\nArial;mso-ansi-language:IN">SMK YP IPPI PETOJO</span><span style="font-family:\r\n&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial"> menjamin ketidakperpihakan\r\n,kejujuran, kedisiplinan dan berwawasan lingkungan.<o:p></o:p></span></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.25in;margin-bottom:.0001pt;text-align:justify;text-indent:.5in"><span lang="FI" style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial;\r\nmso-ansi-language:FI">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</span></p><p class="MsoNormal" style="margin-top:6.0pt;margin-right:0in;margin-bottom:0in;\r\nmargin-left:.5in;margin-bottom:.0001pt;text-align:justify;text-indent:-.25in;\r\nmso-list:l0 level1 lfo1;tab-stops:list 36.15pt"><!--[if !supportLists]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:&quot;Arial Narrow&quot;;\r\nmso-bidi-font-family:&quot;Arial Narrow&quot;">5.<span style="font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-family:&quot;Arial Narrow&quot;,&quot;sans-serif&quot;;mso-bidi-font-family:Arial">Menghasilkan\r\ntenaga kerja&nbsp; bersertifikat kompetensi\r\nyang profesional dan berakhlak mulia.<o:p></o:p></span></p>', 'A.\tVISI : \r\nMenjadi lembaga sertifikasi profesi yang menjamin kompetensi  tenaga kerja yang mampu bersaing,professional, berakhlak mulia dan berwawasan lingkungan.\r\n\r\nB.\tMISI\r\n1.\tLSP SMK YP IPPI PETOJO menjamin menerapkan pedoman BNSP tahun 2014 dan  ISO 17024 \r\n2.\tLSPSMK YP IPPI PETOJOsiap melaksanakan sertifikasi kompetensi secara profesional dan mampu bersaing.\r\n3.\tMemberikan pelayanan uji  sertifikasi kompetensi yang mengutamakan mutu dan kepuasan pelanggan .\r\n4.\tLSPSMK YP IPPI PETOJO menjamin ketidakperpihakan ,kejujuran, kedisiplinan dan berwawasan lingkungan.\r\n5.\tMenghasilkan tenaga kerja  bersertifikat kompetensi yang profesional dan berakhlak mulia.\r\n', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '27', '116967407731946355_2431991636827090_2509765530987003904_n.jpg', '2018-05-08 08:11:08', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100104', 'www.ypippijkt.localhost', 'Pembangunan Mesjid AL-MUTTAQIEN YP IPPI PETOJO', 'pembangunan-mesjid-al-muttaqien-yp-ippi-petojo', '<p class="MsoNormal"><span lang="EN-US">Kehidupan dunia ini tidak abadi. Tak lama\r\najal akan datang menjemput. Dunia hanyalah alam tempat ujian dan kefanaan.\r\nSudah sepatutnya bagi seorang muslim yang beriman akan surga dan neraka,\r\nmempersiapkan bekal untuk memberatkan timbangan amal kebajikannya. Demi meraih\r\nkebahagiaan hakiki dan abadi.<o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p class="MsoNormal"><span lang="EN-US">Sejak jauh hari, Nabi kita\r\nshallallahualaihi wasallam mengingatkan hal ini,<o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p class="MsoNormal"><span lang="EN-US">     \r\n         \r\n<o:p></o:p></span></p><p class="MsoNormal"><span lang="EN-US">&nbsp;</span></p><p dir="ltr" style="box-sizing: border-box; margin-bottom: 1em; color: rgb(124, 124, 124); font-family: &quot;Gentium Basic&quot;, serif; font-size: 20px;">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal"><span lang="EN-US">Orang yang pandai itu ialah, orang yang\r\nmampu mengevaluasi dirinya dan beramal (mencurahkan semua potensi) untuk\r\nkepentingan setelah mati. Sedangkan orang yang lemah ialah, orang yang\r\nmengikuti hawa nafsunya kemudian berangan-angan kosong kepada Allah.\r\n(HR.Tirmidzi)<o:p></o:p></span></p>', 'demo, atikel', ',26940,', '1', '0', '1', '1', '0', '0', '0', '0', '0', '55', '95188432shalat-id-masjid-810x500.jpg', '2018-04-24 12:19:22', '1');
