INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100445', 'www.ypippijkt.localhost', 'Tim Futsal YP IPPI Juara Ke Dua di Tyfo Cup 2018', 'tim-futsal-yp-ippi-juara-ke-dua-di-tyfo-cup-2018', '<div style="text-align: justify;"><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><b><span style="font-size:10.0pt;font-family:" verdana","sans-serif";="" mso-fareast-font-family:"times="" new="" roman";mso-bidi-font-family:arial;="" color:#2a2a2a;mso-fareast-language:in"="">www.ypippijkt.localhost -</span></b><span style="font-size:10.0pt;font-family:" verdana","sans-serif";mso-fareast-font-family:="" "times="" new="" roman";mso-bidi-font-family:arial;color:#2a2a2a;mso-fareast-language:="" in"=""> Tim futsal SMA-SMK YP IPPI berhasil meraih prestasi sebagai juara kedua\r\npada kejuaraan Tyfo Cup X &nbsp;2018 yang diadakan di Sekolah SMA Negeri 44\r\nDuren Sawit, Jakarta Timur.&nbsp;</span><span style="font-size: 10pt; font-family: Verdana, sans-serif;"><o:p></o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(42, 42, 42); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Tim futsal YP IPPI\r\nharus mengakui keunggulan tim Tuan rumah SMA Negeri 44 dengan skor 3 - 2 pada\r\npartai final. "Kami sudah bermain cukup bagus dengan skuad pemain yang\r\nrelatif muda, adapun menang kalah itu hal biasa, bagi kami yang penting\r\npengalaman dan persahabatan antara sesama siswa antar sekolah," tutur Joko\r\nSumarno selaku Pelatih team futsal SMA-SMK YP IPPI Cakung.&nbsp;</span><span style="font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p></o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(42, 42, 42); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Turnamen Tyfo Cup X ini\r\nmerupakan Turnamen ke dua yang di ikuti oleh tim futsal YP IPPI selain untuk\r\nlebih banyak memberikan jam terbang bagi pemain yang kelas X dan tentunya pengalaman bertanding untuk turnamen besar lainnya.<o:p></o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; color: rgb(42, 42, 42); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;">Turnamen ini diikuti\r\noleh tim-futsal terbaik Se-Jabodetabek. Perjuangan dan kerja keras futsal YP\r\nIPPI patut di acungi jempol dalam kiprahnya sudah empat piala yang mereka raih.&nbsp;<o:p></o:p></span></p><p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: 12.1pt;"><span style="font-size: 10pt; font-family: Verdana, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 12.1pt;"></p><div style="text-align: justify;"><span style="color: rgb(42, 42, 42); font-family: Verdana, sans-serif; font-size: 10pt;">Seperti salah satunya piala O2SN dimana tim futsal YP IPPI berhasil menjadi yang terbaik dan menjadi\r\njuara pertama sekecamatan Cakung.&nbsp;</span></div><span style="background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><div style="text-align: justify;"><font color="#2a2a2a" face="Verdana, sans-serif"><span style="font-size: 13.3333px;"><br></span></font></div><font color="#2a2a2a" face="Verdana, sans-serif"><div style="text-align: justify;"><span style="font-size: 10pt;">Dimana waktu itu sekolah YP IPPI ditunjuk untuk\r\nmenjadi tuan rumah. Kita doakan saja semoga kedepannya tim futsal YP IPPI SMA maupun SMK\r\nsemakin jaya dan kembali membawa piala lainnya ke sekolah kita amieen.</span></div></font></span><p></p><p class="MsoNormal">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class="MsoNormal"><span style="line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><br></span></p><div style="text-align: center;"><img src="https://i.imgur.com/CoT9yX3.jpg" width="420"></div>\r\n<!--[if !supportLineBreakNewLine]-->\r\n<!--[endif]--><p></p></div>', 'futsal yp ippi,tyfo cup 2018,', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '37', '416706797FutsalYpIppi.png', '2018-05-16 13:37:48', '1');
INSERT INTO `berita` (`no`, `subdomain`, `judul`, `link`, `isi`, `kata_kunci`, `kategori`, `tampilkan_judul`, `tampilkan_tanggal`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `tgl`, `publish`) VALUES ('100566', 'www.ypippijkt.localhost', 'YP IPPI Juara ( 1 ) O2SN Pencak Silat Jakarta Timur Wilayah Satu', 'yp-ippi-juara--1--o2sn-pencak-silat-jakarta-timur-wilayah-satu', '<div style="text-align: justify;"><p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"></p><div style="text-align: justify;"><span style="font-family: Verdana, sans-serif; font-size: 10pt;">Olimpiade\r\nOlahraga Siswa Nasional atau biasa disingkat ( O2SN ) merupakan program\r\npembinaan kesiswaan yang diselenggarakan Direktorat Pembinaan Sekolah Menengah\r\nAtas ( SMA ) Direktorat Jenderal Pendidikan Dasar dan Menengah, Kementerian\r\nPendidikan dan Kebudayaan sejak tahun 2008.&nbsp;</span></div><div style="text-align: justify;"><font face="Verdana, sans-serif"><span style="font-size: 13.3333px;"><br></span></font></div>\r\n<font face="Verdana, sans-serif"><div style="text-align: justify;"><span style="font-size: 10pt;">Untuk jengjang SMA mempertandingkan 5 ( lima ) cabang olahraga, yaitu : Karate,\r\nPencak Silat, Atletik, Bulu Tangkis, dan Renang.</span></div></font><p></p>\r\n\r\n<p class="MsoNormal" style="text-align: justify; margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><span style="font-size: 10pt; font-family: Verdana, sans-serif;">&nbsp;</span></p>\r\n\r\n<p class="MsoNormal"></p><div style="text-align: justify;"><span style="font-family: Verdana, sans-serif; font-size: 10pt;">O2SN diselenggarakan dengan tujuan untuk\r\nmemfasilitasi, memotivasi, dan juga mengembangkan bakat, minat,&nbsp; dan\r\nprestasi siswa di bidang olahraga.&nbsp;</span></div><span style="line-height: 115%;"><div style="text-align: justify;"><font face="Verdana, sans-serif"><span style="font-size: 13.3333px;"><br></span></font></div>\r\n\r\n<span style="font-family: Verdana, sans-serif; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><div style="text-align: justify;"><span style="font-size: 10pt;">Selain itu, O2SN merupakan ajang pembinaan dan\r\npenumbuhan karakter siswa, baik dalam sikap, mental, seportivitas, kejujuran,\r\ndan solidaritas, seiring dengan upaya penguatan pendidikan karakter.&nbsp;</span></div></span><div style="text-align: justify;"><br></div>\r\n\r\n<span style="font-family: Verdana, sans-serif; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><div style="text-align: justify;"><span style="font-size: 10pt;">kehadiran anak-anak berbakat dari penjuru\r\nIndonesia dalam ajang ini juga sebagai sarana untuk membangun rasa kebersamaan\r\ndan persatuan sebagai generasi penerus bangsa.&nbsp;</span></div></span><div style="text-align: justify;"><br></div>\r\n\r\n<span style="font-family: Verdana, sans-serif; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;"><div style="text-align: justify;"><span style="font-size: 10pt;">Selamat untuk Ananda Nafa menjadi Juara 1 ( satu\r\n) O2SN Pencak Silat Jakarta Timur Wilayah 1 ( satu )</span></div></span>\r\n<!--[if !supportLineBreakNewLine]--><br>\r\n<!--[endif]--></span><span style="font-size:10.0pt;line-height:115%;font-family:\r\n" verdana","sans-serif""=""><o:p></o:p></span><p></p></div>', 'o2sn,silat', '', '1', '0', '1', '1', '0', '0', '0', '0', '0', '28', '227326399a3jpg-420x420copy.jpg', '2018-05-23 09:26:30', '1');


