INSERT INTO `halaman` (`no`, `subdomain`, `judul`, `link`, `tipe`, `idtipe`, `isi`, `kata_kunci`, `tampilkan_judul`, `tampilkan_isi`, `tampilkan_gambar`, `tampilkan_tanggal`, `tampilkan_komentar`, `tampilkan_formulir`, `tampilkan_pembaca`, `tampilkan_katakunci`, `tampilkan_berbagi`, `jumlah_pembaca`, `gambar`, `urutan`, `uphalaman`, `subhalaman`, `tgl`, `publish`) VALUES ('218396', 'www.ypippijkt.localhost', 'Sejarah', 'sejarah', 'tulis', '0', 'Ini adalah contoh sejarah singkat sekolah<br>\r\n\t\t\t\t\t\t\tSMA Negeri 1 Harapan berdiri sejak tanggal 1 November tahun 1877. Terletak di Jalan Bodjong 149 (Jl. Pemuda 149). Mula-mula adalah HBS (Hogere Bunger School). Pada tahun 1930 dipergunakan untuk untuk HBS dan AMS (Algemene Meddelbare School), kemudian tahun 1937 HBS pindah di jalan Oei Tong Ham (sekarang Jl Menteri Supeno No. 1 / SMU 1 Harapan), sedangkan bangunan di jalan Bodjong dipergunakan untuk AMS dan MULO.Pada zaman pendudukan Jepang bangunan ini dipergunakan untuk SMT (Sekolah Menengah Tinggi).', 'sejarah', '1', '1', '1', '0', '0', '0', '0', '0', '0', '30', '', '1', '218389', '0', '2018-05-01 13:30:16', '1');
