INSERT INTO `sambutan` (`no`, `subdomain`, `judul`, `link`, `isi`, `gambar`, `tgl`, `publish`) VALUES ('14261', 'www.ypippijkt.localhost', 'Sambutan Kepala Sekolah', '', '<p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" style="text-transform: capitalize;">Bismillahirohmannirrohim</p><p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" text-align:="" justify;="" style="text-transform: capitalize;">Assalamualaikum Warahmatullah Wabarakatuh</p><p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" text-align:="" justify;="" style="text-transform: capitalize;">Alhamdulillahi Robbil Alamin Kami Panjatkan Kehadlirat Allah SWT, Bahwasannya Dengan Rahmat Dan Karunia-Nya Lah Akhirnya Website Sekolah Ini Dengan Alamat&nbsp;<strong 0px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="">www.ypippijkt.localhost</strong>&nbsp;Dapat Kami Perbaharui. Kami Mengucapkan Selamat Datang Di Website Kami SMP - SMK - SMA IT YP IPPI Jakarta Yang Saya Tujukan Untuk Seluruh Unsur Pimpinan, Guru, Karyawan Dan Siswa Serta Khalayak Umum Guna Dapat Mengakses Seluruh Informasi Tentang Segala Profil, Aktifitas/Kegiatan Serta Fasilitas Sekolah Kami.</p><p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" text-align:="" justify;="" style="text-transform: capitalize;">Kami Selaku Pimpinan Sekolah Mengucapkan Terima Kasih Kepada Tim Pembuat Website Ini Yang Telah Berusaha Untuk Dapat Lebih Memperkenalkan Segala Perihal Yang Dimiliki Oleh Sekolah. Dan Tentunya Website Sekolah Kami Masih Terdapat Banyak Kekurangan, Oleh Karena Itu Kepada Seluruh Civitas Akademika Dan Masyarakat Umum Dapat Memberikan Saran Dan Kritik Yang Membangun Demi Kemajuan Website Ini Lebih Lanjut.</p><p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" text-align:="" justify;="" style="text-transform: capitalize;">Saya Berharap Website Ini Dapat Dijadikan Wahana Interaksi Yang Positif Baik Antar Civitas Akademika Maupun Masyarakat Pada Umumnya Sehingga Dapat Menjalin Silaturahmi Yang Erat Disegala Unsur. Mari Kita Bekerja Dan Berkarya Dengan Mengharap Ridho Sang Kuasa Dan Keikhlasan Yang Tulus Dijiwa Demi Anak Bangsa.</p><p 0px;="" margin-bottom:="" 20px;="" outline:="" none;="" list-style:="" border:="" 0px="" box-sizing:="" border-box;="" font-family:="" "open="" sans";="" font-size:="" 13px;="" text-transform:="" text-align:="" justify;="" style="text-transform: capitalize;">Terima Kasih Semoga Allah Azza Wa Jalla Menyertai Doa Kita SemuaAmin.</p>', '', '2018-05-01 13:55:31', '1');
INSERT INTO `sambutan` (`no`, `subdomain`, `judul`, `link`, `isi`, `gambar`, `tgl`, `publish`) VALUES ('14255', 'www.ypippijkt.localhost', 'Sambutan Kepala Sekolah', '', 'Ini adalah contoh sambutan / kata Pengantar dari Kepala Sekolah.<br> Sebagai lembaga pendidikan, SMA Negeri 1 Harapan tanggap dengan perkembangan teknologi tersebut. Dengan dukungan SDM yang di miliki sekolah ini siap untuk berkompetisi dengan sekolah lain dalam pelayanan informasi publik. Teknologi Informasi Web khususnya, menjadi sarana bagi SMA Negeri 1 Harapan untuk memberi pelayanan informasi secara cepat, jelas, dan akuntable. Dari layanan ini pula, sekolah siap menerima saran dari semua pihak yang akhirnya dapat menjawab Kebutuhan masyarakat. ', '', '2018-04-30 12:47:29', '1');
