ukti, selalu menempatkan dirinya dalam setiap langkah siswanya untuk merintis masa depan.</p><p style=background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; font-stretch: normal; font-family: Georgia, Arial, &quot;century gothic&quot;, verdana, sans-serif; line-height: 18px; text-align: justify; text-transform: none;>Kami ucapkan terimakasih atas kunjungan Bapak Ibu, orang tua, wali murid, anak-anak didik kami dan masyarakat umum di website ini.</p><p style=background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; font-stretch: normal; font-family: Georgia, Arial, &quot;century gothic&quot;, verdana, sans-serif; line-height: 18px; text-align: justify; text-transform: none;>Semoga informasi yang kami berikan dapat memberi manfaat bagi kita semua, dan dengan besar hati kami siap menerima masukan kritikan yang membangun demi kemajuan &amp; keberhasilan anak didik sekolah SMP - SMK - SMA IT YP IPPI Jakarta.</p><p style=background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; border: 0px; margin-bottom: 10px; padding: 0px; vertical-align: baseline; font-stretch: normal; font-family: Georgia, Arial, &quot;century gothic&quot;, verdana, sans-serif; line-height: 18px; text-align: justify; text-transform: none;>Salam<br></p>', '48911102LogoIPPIbaru.jpg', '2018-05-01 13:54:09', '1');


